import React, { useEffect } from 'react'
import axios from 'axios'

const M_news = () => {

  axios.defaults.withCredentials = true;
  
    useEffect(() => {
      const url = "http://127.0.0.1:5021/news_list";
      axios.get(url)
      .then( response => {
          
          console.log(response[0]);
      })
      
      .catch(function(e) {
          console.log(e);
      })
    }, [])
    
    
    
  
  
  return (
    <div>

      <h1>news_axios</h1>
    </div>
  )
}

export default M_news
